function App() {
  const [mode, setmode] = useState('light');
  const togglestyle=()=>{
    if(mode==="light"){
      setmode("dark");
    }
    else{
      setmode("light");
    }
  }
  document.documentElement.setAttribute('data-bs-theme', mode);
  return (
    <></>
  );
}

export default App;
